  PRIMARY KEY (`log_id`),
  KEY `fk_log_ccbiii` (`cb_code`) USING BTREE,
  CONSTRAINT `trick_ibfk_1` FOREIGN KEY (`cb_code`) REFERENCES `chess_info` (`code`)
